import React, { useState, useEffect } from "react";

const Filtro = ({ onFiltrar }) => {
  const [categorias, setCategorias] = useState([]);
  const [epocas, setEpocas] = useState([]);
  const [solos, setSolos] = useState([]);
  const [sóis, setSóis] = useState([]);

  const [filtros, setFiltros] = useState({
    status: "",
    id_categoria: "",
    id_epoca: "",
    id_solo: "",
    id_sol: ""
  });

  // 🔹 Buscar opções de filtros (pode vir de endpoints específicos)
  useEffect(() => {
    const fetchFiltros = async () => {
      try {
        const [catRes, epocaRes, soloRes, solRes] = await Promise.all([
          fetch("/api/categorias").then(r => r.json()),
          fetch("/api/epocas").then(r => r.json()),
          fetch("/api/solos").then(r => r.json()),
          fetch("/api/sol").then(r => r.json())
        ]);
        setCategorias(catRes);
        setEpocas(epocaRes);
        setSolos(soloRes);
        setSóis(solRes);
      } catch (err) {
        console.error("Erro ao buscar filtros:", err);
      }
    };
    fetchFiltros();
  }, []);

  // 🔹 Atualizar estado local
  const handleChange = (e) => {
    setFiltros({
      ...filtros,
      [e.target.name]: e.target.value
    });
  };

  // 🔹 Enviar filtros para o pai (Página de listagem)
  const aplicarFiltros = () => {
    onFiltrar(filtros);
  };

  const limparFiltros = () => {
    const reset = { status: "", id_categoria: "", id_epoca: "", id_solo: "", id_sol: "" };
    setFiltros(reset);
    onFiltrar(reset);
  };

  return (
    <div className="filtro-container">
      <h3>Filtrar Receitas</h3>

      <select name="status" value={filtros.status} onChange={handleChange}>
        <option value="">Todos os status</option>
        <option value="pendente">Pendente</option>
        <option value="aprovado">Aprovado</option>
        <option value="rejeitado">Rejeitado</option>
      </select>

      <select name="id_categoria" value={filtros.id_categoria} onChange={handleChange}>
        <option value="">Todas as categorias</option>
        {categorias.map(c => (
          <option key={c.id} value={c.id}>{c.nome}</option>
        ))}
      </select>

      <select name="id_epoca" value={filtros.id_epoca} onChange={handleChange}>
        <option value="">Todas as épocas</option>
        {epocas.map(e => (
          <option key={e.id} value={e.id}>{e.nome}</option>
        ))}
      </select>

      <select name="id_solo" value={filtros.id_solo} onChange={handleChange}>
        <option value="">Todos os solos</option>
        {solos.map(s => (
          <option key={s.id} value={s.id}>{s.nome}</option>
        ))}
      </select>

      <select name="id_sol" value={filtros.id_sol} onChange={handleChange}>
        <option value="">Todos os tipos de sol</option>
        {sóis.map(s => (
          <option key={s.id} value={s.id}>{s.nome}</option>
        ))}
      </select>

      <div className="botoes-filtro">
        <button onClick={aplicarFiltros}>Aplicar</button>
        <button onClick={limparFiltros}>Limpar</button>
      </div>
    </div>
  );
};

export default Filtro;
